import STable from '@/components/table/';
import { getRoleList, getServiceList } from '@/api/manage';
export default {
  name: "TableList",
  components: {
    STable: STable
  },
  data: function data() {
    return {
      description: '列表使用场景：后台管理中的权限管理以及角色管理，可用于基于 RBAC 设计的角色权限控制，颗粒度细到每一个操作类型。',
      visible: false,
      labelCol: {
        xs: {
          span: 24
        },
        sm: {
          span: 5
        }
      },
      wrapperCol: {
        xs: {
          span: 24
        },
        sm: {
          span: 16
        }
      },
      form: null,
      mdl: {},
      // 高级搜索 展开/关闭
      advanced: false,
      // 查询参数
      queryParam: {},
      // 表头
      columns: [{
        title: '唯一识别码',
        dataIndex: 'id'
      }, {
        title: '角色名称',
        dataIndex: 'name'
      }, {
        title: '状态',
        dataIndex: 'status'
      }, {
        title: '创建时间',
        dataIndex: 'createTime',
        sorter: true
      }, {
        title: '操作',
        width: '150px',
        dataIndex: 'action',
        scopedSlots: {
          customRender: 'action'
        }
      }],
      // 加载数据方法 必须为 Promise 对象
      loadData: function loadData(parameter) {
        return getRoleList(parameter).then(function (res) {
          return res.result;
        });
      },
      selectedRowKeys: [],
      selectedRows: []
    };
  },
  created: function created() {
    getServiceList().then(function (res) {
      console.log('getServiceList.call()', res);
    });
    getRoleList().then(function (res) {
      console.log('getRoleList.call()', res);
    });
  },
  methods: {
    handleEdit: function handleEdit(record) {
      this.mdl = Object.assign({}, record);
      this.mdl.permissions.forEach(function (permission) {
        permission.actionsOptions = permission.actionEntitySet.map(function (action) {
          return {
            label: action.describe,
            value: action.action,
            defaultCheck: action.defaultCheck
          };
        });
      });
      this.visible = true;
    },
    handleOk: function handleOk() {},
    onChange: function onChange(selectedRowKeys, selectedRows) {
      this.selectedRowKeys = selectedRowKeys;
      this.selectedRows = selectedRows;
    },
    toggleAdvanced: function toggleAdvanced() {
      this.advanced = !this.advanced;
    }
  },
  watch: {
    /*
    'selectedRows': function (selectedRows) {
      this.needTotalList = this.needTotalList.map(item => {
        return {
          ...item,
          total: selectedRows.reduce( (sum, val) => {
            return sum + val[item.dataIndex]
          }, 0)
        }
      })
    }
    */
  }
};
